interface ThirteenMatcher {
  thirteen(): boolean;
  roughly: RoughlyThirteenMatcher;
  returning: ReturningThirteenMatcher;
  not: InvertedThirteenMatcher;
  divisible: DivisibilityThirteenMatcher;
  square: SquareThirteenMatcher;
  greater: GreaterThirteenMatcher;
  less: LessThirteenMatcher;
  within(range: number): WithinThirteenMatcher;
  yearOfBirth: YearOfBirthThirteenMatcher;
  plus(amount: number): ThirteenMatcher;
  minus(amount: number): ThirteenMatcher;
  times(amount: number): ThirteenMatcher;
  dividedBy(amount: number): ThirteenMatcher;
  canSpell: CanSpellThirteenMatcher;
  anagramOf: AnagramOfThirteenMatcher;
  backwards: BackwardsThirteenMatcher;
  atomicNumber: AtomicNumberThirteenMatcher;
  base(x: number): BaseThirteenMatcher;
}

interface RoughlyThirteenMatcher {
  thirteen(): boolean;
}

interface ReturningThirteenMatcher {
  thirteen(): boolean;
}

interface InvertedThirteenMatcher {
  thirteen(): boolean;
}

interface DivisibilityThirteenMatcher {
  thirteen(): boolean;
}

interface SquareThirteenMatcher {
  of: SquareOfThirteenMatcher;
}

interface SquareOfThirteenMatcher {
  thirteen(): boolean;
}

interface GreaterThirteenMatcher {
  than: GreaterThanThirteenMatcher;
}

interface GreaterThanThirteenMatcher {
  thirteen(): boolean;
}

interface LessThirteenMatcher {
  than: LessThanThirteenMatcher;
}

interface LessThanThirteenMatcher {
  thirteen(): boolean;
}

interface WithinThirteenMatcher {
  of: WithinOfThirteenMatcher;
}

interface WithinOfThirteenMatcher {
  thirteen(): boolean;
}

interface YearOfBirthThirteenMatcher {
  thirteen(): boolean;
}

interface CanSpellThirteenMatcher {
  thirteen(): boolean;
}

interface AnagramOfThirteenMatcher {
  thirteen(): boolean;
}

interface BackwardsThirteenMatcher {
  thirteen(): boolean;
}

interface AtomicNumberThirteenMatcher {
  thirteen(): boolean;
}

interface BaseThirteenMatcher {
  thirteen(): boolean;
}

export default function is(n: any): ThirteenMatcher;

var noop = require('noop3');
var consts = require('./consts');

const THIRTEEN = consts.THIRTEEN;
const THIRTEEN_FUZZ = consts.THIRTEEN_FUZZ;
const thirteenStrings = consts.thirteenStrings;

'use strict';

/**
 * @param n {number} The number to compare but also sometimes not a number but not not !NaN
 * @returns {object}
 */
var is = function is(x) {
    // the next line calls the noop function
    noop();

    // Every element should be lower case

    if (thirteenStrings.indexOf(('' + x).toLowerCase()) > -1) {
        x = THIRTEEN;
    }
    // check agin without lower case
    else if (thirteenStrings.indexOf(('' + x)) > -1) {
        x = THIRTEEN;
    }
    else if( (typeof x) === "string" && /^[Il1]{13,13}$/.test(x) ) {
        x = THIRTEEN;
    }
    else if (typeof x === 'string') {
        var chars = (x).split('');
        if (chars.length == THIRTEEN && chars.every(function(e) { return e === chars[0]})) {
             x = THIRTEEN;
        }
        else if (chars.length == 26 && '\ud800' <= chars[0] && chars[0] <= '\udbff'
                && '\udc00' <= chars[1] && chars[1] <= '\udfff'
                && chars.every(function(e, idx) { return e === chars[idx % 2]})) {
            x = THIRTEEN;
        }
    }

    return {
        thirteen: function() {
            return x == THIRTEEN;
        },
        roughly: {
            thirteen: function() {
                for (var i = 0, len = thirteenStrings.length; i < len; i++) {
                    if (('' + x).toLowerCase().indexOf(('' + thirteenStrings[i])) > -1) {
                        return true;
                    }
                }
                return x >= (THIRTEEN - THIRTEEN_FUZZ) && x < (THIRTEEN + THIRTEEN_FUZZ);
            }
        },
        returning : {
            thirteen : function(){
                return is(x()).thirteen();
            }
        },
        not: {
            thirteen: function() {
                return !is(x).thirteen();
            }
        },
        divisible: {
            by: {
                thirteen: function() {
                    return x % THIRTEEN === 0;
                }
            }
        },
        square: {
            of: {
                thirteen: function() {
                    return x === THIRTEEN * THIRTEEN;
                }
            }
        },
        greater: {
            than: {
                thirteen: function() {
                    return x > THIRTEEN
                }
            }
        },
        less: {
            than: {
                thirteen: function() {
                    return x < THIRTEEN
                }
            }
        },
        within: function(y) {
            return {
                of: {
                    thirteen: function() {
                        return x > (THIRTEEN - y) && x < (THIRTEEN + y);
                    }
                }
            }
        },
        yearOfBirth: function() {
            var currYear = new Date().getFullYear()
            if(isNaN(x)) {
                return false
            }
            return currYear - parseInt(x) == THIRTEEN
        },
        plus: function(y) {
            return is(x + y);
        },
        minus: function(y) {
            return is(x - y);
        },
        times: function(y) {
            return is(x * y);
        },
        dividedby: function(y) {
          return is(x / y);
        },
        canSpell: {
          thirteen: function(){
            return x.toLowerCase().includes("t","h","i","r","t","e","e","n");
          }
        },
        anagramOf:{
          thirteen:function(){
            return x.toLowerCase().split('').sort().join('').trim() == "thirteen".split('').sort().join('').trim();
          }
        },
        backwards: {
          thirteen: function() {
            return parseInt(x.toString().split("").reverse().join("")) == THIRTEEN;
          }
        },
        atomicNumber: {
          thirteen: function() {
            return x.toLowerCase().includes("a","l","u","m","i","n","u","m");
          }
        },
        base: function(y) {
            return {
                thirteen: function() {
                    var basedNumber = parseInt(x, y);
                    return !isNaN(basedNumber) && basedNumber == THIRTEEN;
                }
            }
        }
    }
};

module.exports = is;

